const getBattingStatsByPlayerInnings = async ({inningsData, playerName}) => {
  const ballsData = [];

  if (inningsData.length > 0) {
    for await (data of inningsData[0].data) {
      if (playerName === data.batter.name) {
        for await (ball of data.overs[0].balls) {
          ballsData.push(ball);
